Speed Up and Simplify MongoDB Aggregate Function<p>I have the following function, which is quite complicated, but i'm hoping someone might be able to understand it help me simplify/speed it up.</p>
<p>In this function i end up with an array that contains a list of primaryStores and the number of products coming from each one to my group of stores. However, it only counts the products, if that store has an accepted connection with the particular primary store in question. (Some might have an accepted connection to one and not the other yet)</p>
<p>I will try and explain how it works:</p>
<p>I pass into the function a list of storeIDs. I loop through each one to find out which primary stores each one has an accepted connection with.
Out of those with an accepted connection, i just get the store ID.
I then find out what products are in my store, and get the product IDs and the linked ID connecting them to my store.
I then begin my aggregate function which starts off by finding which of my products have a connection to another store. I then look up the other stores info to get the store ID and filter to only get ones i am connected to. I then project this and group by store id/name and get the total number of products coming from each primary store and an array containing a list of all the products from each one.
I push each connected primaryStore for each of my main stores into an array called 'allFeederStores'.</p>
<p>As i am looping through each of my main stores one at a time to get this information. At the end I have a reduce function which combines any duplicating primaryStores that appear in my array, and concatenate the total products. This provides my with an overview of where the majority of my products are coming from for all of my main stores.</p>
<p>I am trying to get rid of the for loop at the beginning, so i don't have to loop through each store at once. But i can't figure out, how i can check a signed connection exists between the two individual stores without doing them seperate.</p>
<p>It's not likely anyone will understand this, but if anyone does and can help I would much appreciate it!</p>
<p>Below is my code:</p>
<pre><code>  async getFeederStores(storeIDs): Promise&lt;any[]&gt; {

    let allFeederStores = [];
    for (let storeID of storeIDs) {
      //get all the signed connections this store has with primary stores
      const linkedPrimaryStores = await this.linkedStoreModel.aggregate([
        {
          $match: {
            main_store: storeID,
            primary_store_signed_by: { $ne: null },
          },
        },
      ]);

      //get just the primary store ids from the linked primary stores
      const primaryStoreIDs = linkedPrimaryStores.map((linkedPrimaryStore) =&gt; {
        return linkedPrimaryStore.primary_store;
      });

      //get all products from this store
      const products = await this.productStoreModel
        .find({
          store: storeID,
        })
        .select(&quot;product&quot;)
        .lean();

      //get product ids from this store
      const productIDs = products.map((product) =&gt; {
        return product.product;
      });

      //get the product store ids
      const productStoreIDs = products.map((product) =&gt; {
        return product._id;
      });

      const linkedStores = await this.productStoreModel.aggregate([
        {
          //get the products connected to other stores
          $match: {
            product: {
              $in: productIDs,
            },
            _id: {
              $nin: productStoreIDs,
            },
          },
        },
        //look up the other stores info
        {
          $lookup: {
            from: &quot;stores&quot;,
            localField: &quot;store&quot;,
            foreignField: &quot;_id&quot;,
            as: &quot;store&quot;,
          },
        },
        //unwind the stores info
        {
          $unwind: &quot;$store&quot;,
        },
        //filter to only get primary stores that are connected to this main store
        {
          $match: {
            &quot;store._id&quot;: { $in: primaryStoreIDs },
          },
        },
        //project to only get the store id/name and the product store id
        {
          $project: {
            &quot;store._id&quot;: 1,
            &quot;store.name&quot;: 1,
            product_store: &quot;$_id&quot;,
          },
        },
        //group by store - get the total number of products coming from each store and the products info from each one
        {
          $group: {
            _id: &quot;$store._id&quot;,
            name: { $first: &quot;$store.name&quot; },
            total_products: { $sum: 1 },
            products: {
              $push: {
                product_store: &quot;$product_store &quot;,
              },
            },
          },
        },
      ]);
      for (let primaryStore of linkedPrimaryStores) {
        allFeederStores.push(primaryStore);
      }
    }

    //loop through all the feeder stores
    //any duplicate stores, combine the total number of products and the products array
    let concatenatedPrimaryStores = allFeederStores.reduce((accum, cv) =&gt; {
      const index = accum.findIndex((item) =&gt; item._id === cv._id);
      if (index === -1) {
        accum.push(cv);
      } else {
        accum[index].total_products += &quot;, &quot; + cv.total_products;
        accum[index].products += &quot;, &quot; + cv.products;
      }
      return accum;
    }, []);

    return concatenatedPrimaryStores;
  }
</code></pre>
<p>I have added some sample data below. In this case MainStore1 has a signed connection with PrimaryStore1 but not PrimaryStore1 (so any products coming from that primary store won't be counted for this main store)
However MainStore2 has a signed connection with both PrimaryStore1 and PrimaryStore2, (so any products coming from both those primary stores will be counted for this main store)</p>
